import _ from 'lodash';
import React, { Component } from 'react';

const serv = ['A/C Replacement', 'Heating Replacement', 'Standard Testing'];
const list = serv.map((s) =>
	<li>{s}</li>
);

const service = [
	{name: 'A/C Replacement'},
	{name: 'Heating Replacement'},
	{name: 'Standard Testing'}
];

class Services extends Component {
	renderContent() {
		return _.map(service, ({name}) => {
			<li>{name}</li>
		});
	}
	render() {
        return (
            <div id="main">
				<div id="content">
					<section>
						<div className="container">
							<ul>{this.renderContent()}</ul>
						</div>
					</section>
				</div>
			</div>
        );
    }
}

export default Services;
